import React, { useState, useEffect } from 'react';

const AllSurveys = () => {
    const [surveys, setSurveys] = useState([]);

    // Função para buscar as entrevistas
    const fetchSurveys = async () => {
        try {
            const response = await fetch('http://localhost:4000/api/surveys');
            const data = await response.json();
            setSurveys(data);
        } catch (error) {
            console.error('Erro ao carregar as entrevistas:', error);
        }
    };

    // Carregar as entrevistas ao montar o componente
    useEffect(() => {
        fetchSurveys();
    }, []);

    return (
        <div>
            <h1>Entrevistas Realizadas</h1>
            {surveys.length > 0 ? (
                surveys.map((survey) => (
                    <div key={survey.surveyId} className="survey-item">
                        <h2>
                            Entrevista com {survey.entrevistadoName} - {survey.entrevistadorName}
                        </h2>
                        <small>ID: {survey.surveyId}</small>
                        <button className="expand-button">Expandir</button>
                        <div className="survey-details">
                            <ul>
                                <li><strong>Nome do Entrevistado:</strong> {survey.entrevistadoName}</li>
                                <li><strong>Função do Entrevistado:</strong> {survey.entrevistadoJobTitle}</li>
                                <li><strong>Localização do Entrevistado:</strong> {survey.entrevistadoLocation}</li>
                                <li><strong>Área Funcional do Entrevistado:</strong> {survey.entrevistadoFunctionalArea}</li>
                                <li><strong>Nome do Entrevistador:</strong> {survey.entrevistadorName}</li>
                                <li><strong>Função do Entrevistador:</strong> {survey.entrevistadorJobTitle}</li>
                                <li><strong>Localização do Entrevistador:</strong> {survey.entrevistadorLocation}</li>
                                <li><strong>Área Funcional do Entrevistador:</strong> {survey.entrevistadorFunctionalArea}</li>
                                <li><strong>Data:</strong> {survey.data}</li>
                                <li><strong>Normas Aplicáveis:</strong> {survey.normas_aplicaveis}</li>
                                <li><strong>Índice da Pergunta:</strong> {survey.indice_pergunta}</li>
                                <li><strong>Âmbito:</strong> {survey.ambito}</li>
                                <li><strong>Pergunta:</strong> {survey.pergunta}</li>
                                <li><strong>Resposta:</strong> {survey.resposta}</li>
                                <li><strong>Comentários:</strong> {survey.comentarios}</li>
                                <li><strong>Documentação:</strong> {survey.documentacao || 'Nenhum arquivo selecionado'}</li>
                            </ul>
                        </div>
                    </div>
                ))
            ) : (
                <p>Carregando as entrevistas...</p>
            )}
        </div>
    );
};

export default AllSurveys;
